export default (props) =>(
    <div id="clase-container">
    <h2>Clase de {props.nombre}</h2>
    {props.clase.map(item=>{
        return(
            <div className="clase-list">
                <img src={item.foto} alt=""/>
                <p>{item.first_name} {item.last_name}</p>
            </div>
        )          
    })}

    <style jsx>
    {
        '\
            #clase-container{\
                perspective:500px;\
            }\
            .clase-list{\
                display:flex;\
            }\
            .clase-list img{\
                padding:3px;\
                border:1px solid#ccc;\
            }\
            .clase-list p{\
                font-size:10px;\
                font-weight:bold;\
                for-style:italic;\
                margin-left:12px;\
            }\
        '
    }

    </style>

    </div>
)
